fibonacci:
import printf;
int fibonacci(int n) {
    if (n <= 1){
        return n;
    }
    return fibonacci(n - 1) + fibonacci(n - 2);
}
void main() {
    int i;
    for (i = 0; i < 10; i++){
        printf("%d ", fibonacci(i));
    }
}

bubble sort:
import printf; 

int arr[] = {5, 2, 3, 4, 1};

void bubble_sort(int n) {
    int i, j, temp;
    for (i = 0; i < n - 1; i++){
        for (j = 0; j < n - i - 1; j++){
            if (arr[j] > arr[j + 1]){
                temp = arr[j];
                arr[j] = arr[j + 1];
                arr[j + 1] = temp;
            }
        }
    }
}
void main() {
    int i;
    bubble_sort(len(arr));
    for (i = 0; i < len(arr); i++){
        printf("%d ", arr[i]);
    }
}
